import {
    SET_DOGS,
    SET_LOADING,
    SET_ERROR,
    SET_TEMPERAMENTS,
    SET_FILTER,
    SET_SORT,
    SET_CURRENT_PAGE,
    SET_DOGS_COUNT,
  } from './actions/types';

  const initialState = {
    dogs: [],
    loading: false,
    error: null,
    temperaments: [],
    filter: null,
    sort: null,
    currentPage: 1,
    dogsCount: 0,
  };

  const reducer = (state = initialState, action) => {
    switch (action.type) {
      case SET_DOGS:
        return {
          ...state,
          dogs: action.payload,
        };
      case SET_LOADING:
        return {
          ...state,
          loading: action.payload,
        };
      case SET_ERROR:
        return {
          ...state,
          error: action.payload,
        };
      case SET_TEMPERAMENTS:
        return {
          ...state,
          temperaments: action.payload,
        };
      case SET_FILTER:
        return {
          ...state,
          filter: action.payload,
        };
      case SET_SORT:
        return {
          ...state,
          sort: action.payload,
        };
      case SET_CURRENT_PAGE:
        return {
          ...state,
          currentPage: action.payload,
        };
      case SET_DOGS_COUNT:
        return {
          ...state,
          dogsCount: action.payload,
        };
      default:
        return state;
    }
  };

  export default reducer;
